import productStyle from "./Product.module.css";
import data from "../../utils/data";

export default function Product() {
  return (
    <div>
      <div className={productStyle.imgBox}>
        {data.map((obj) => {
          if (obj.id <= 4) {
            return <img className={productStyle.imgMin} src={obj.image}></img>;
          }
        })}
      </div>
    </div>
  );
}
